const Users=(props)=>{
    console.log(props)
    return(
        <div>
        <h1>Users</h1>
    <ul>{props.map((user)=>{
        return(
            <div key={user.id}>
                <li>{user.name}</li>
                <li>{user.username}</li>
                <li>{user.email}</li>
                <li>{user.address}</li>
                <li>{user.phone}</li>
                <li>{user.website}</li>
                <li>{user.company}</li>
            </div>
        )
    })}</ul>
    </div>
    );

}

export default Users
